import Link from 'next/link'
import React from 'react'
import {Layout, Menu, Button, Row, Col} from 'antd'
import {
    UserOutlined,
    MenuOutlined,

} from '@ant-design/icons'

const {Header, Sider} = Layout
const {SubMenu} = Menu

class HomePage extends React.Component {
    state = {
        collapsed: false,
    }

    toggleCollapse = () => {
        this.setState({
            collapsed: !this.state.collapsed,
          });
    }

    render(){
    return(
        <Layout>
            {/* <Sider>
                <Menu>

                </Menu>
            </Sider> */}
            <Header>
                <Row>
                    <Col span={3}>
                        <Button>
                            <MenuOutlined style={{fontSize: '30px'}}/>
                        </Button>
                    </Col>
                    <Col span={3}  style={styles.title}>
                        <Link href = '/home'>
                            <a>UltiNote</a>
                        </Link>
                    </Col>
                    <Col span={4} offset='10'>
                        <Link href = '/home'>
                            <a><UserOutlined style={{fontSize: '30px'}}/></a>
                        </Link>
                    </Col>
                </Row> 
            </Header> 
        </Layout>  
    )
    }
}

export default HomePage

const styles = {
    nav: {

    },
    sideBar: {

    },
    title: {
        fontFamily: 'verdana', 
        fontSize: '24px',
    },
    pfp: {
        float: 'right', 
    },
}
